Kortney Kane - You Win Some, You Lose Some, Then You Get Fucked Some
Added: September 23, 2010

&quot;Kortney is a compulsive gambler who is out of control. She is already in debt with a loan shark when she guarantees him she has an inside scoop on a certain horse that will win a race. The bookie fronts her more money but when the horse loses she has no way to pay him back and is forced to whore her way back even.
